import React from 'react';
import { Text, StyleSheet, View, Button, TouchableOpacity } from 'react-native';
const styles = StyleSheet.create({
  text: {
    fontSize: 30
  }
});
export default class HomeScreen extends React.Component {

  constructor(props) {
    super(props);
    this.state = this.props.navigation.state.params
  }

  updateMessage = ()=>{
    this.setState({text:'HIIIII'})
  }
  render(){
  // console.log(this.props)
  return (
    <View>

      <Text style={styles.text}>Hi there!</Text>  
      <Text style={styles.text}>{this.state.text}</Text>
      <Button
      onPress={this.updateMessage}
      title="test"
      />
      <Button
        onPress={() => this.props.navigation.navigate('Attendance')}
        title="Attendance Log"
      />
      <Button
        onPress={() => this.props.navigation.navigate('Profile')}
        title="Your Profile"
      />
      <Button
        title="Duty Log"
        onPress={() => this.props.navigation.navigate('DutyLog')}
      />
      <Button
        title="Scan QR"
        onPress={() => this.props.navigation.navigate('Scanner')}
      />
      <Button
        title="Trip Details"
        onPress={() => this.props.navigation.navigate('Trip')}
      />
      <Button
        onPress={() => this.props.navigation.navigate('Components')}
        title="Go to Components Demo"
      />
      <Button
        title="Go to List Demo"
        onPress={() => this.props.navigation.navigate('List')}
      />
      <Button
        title="Go to Image Demo"
        onPress={() => this.props.navigation.navigate('Image')}
      />
      <Button
        title="Go to Counter Demo"
        onPress={() => this.props.navigation.navigate('Counter')}
      />
      <Button
        title="Go to Color Demo"
        onPress={() => this.props.navigation.navigate('Color')}
      />
      <Button
        title="Go to Square Demo"
        onPress={() => this.props.navigation.navigate('Square')}
      />
      <Button
        title="Go to Text Demo"
        onPress={() => this.props.navigation.navigate('Text')}
      />
      <Button
        title="Go to Box Demo"
        onPress={() => this.props.navigation.navigate('Box')}
      />
    </View>
  );}
};
